import React, { useState } from 'react';


function Header () {
    let items = ["Merlin", "Was", "Geht", "Ab"]
    const [selectedItem, setSelectedItem] = useState<string | null>(null);

    return (
        <>  
            <div className="flex mt-12 flex-col justify-center items-center">
                <h1 className="text-4xl text-primary font-bold mb-4">List</h1>
                <ul className= "list-divide-y divide-gray-300">
                    {items.map((item, index) => (
                        <li key={item} onClick= {() => setSelectedItem(item) } className= "border py-2 px-4 hover:border-blue-500"> 
                        {item}
                        </li>
                    ))}
                </ul>
                {selectedItem && (
                <div className="mt-4 text-xl">
                    Selected: {selectedItem}
                </div>
                )}
             </div>
        </>
    )
}

export default Header;
